export default function Dialog({title, message, onConfirm, onCancel}) {
    return (
        <div>这是一个弹窗
            <div>{title}</div>
            <div>{message}</div>
            <button onClick={onConfirm}>确定</button>
            <button onClick={onCancel}>取消</button>
        </div>
    )
};
